import img from "../src/images/slide-1.png";

const Interest = () => {

return(
    <>

<div className="container">
    <div className="row text-white text-capitalize col-10 col-sm-8 col-lg-10 col-md-8 offset-lg-0 offset-sm-2 ml-sm-2">
        <h1>Are You a Painter ?</h1>
        <p className="ml-3">Get on board with us</p>
        <ul>
            <li>Increase your reach</li>
            <li>Organise your system</li>
            <li>Strenthen your online reputation</li>
        </ul>
            
        </div>

</div>

    </>
);
};
export default Interest;
